gGx(){return"Die Entwicklung von Anwendungssoftware ist unsere Spezialdisziplin. Wir entwickeln Software f\xfcr Sie oder verst\xe4rken Ihr Entwicklerteam in Ihren Projekten mit unseren Spezialisten."},
gBZ(){return"Anwendungen f\xfcr das Android OS"},
gNh(){return"Android ist ein modernes Betriebssystem f\xfcr mobile Endger\xe4te und wird von der Open Handset Alliance entwickelt. Es basiert auf dem Linux-Betriebssystem, Anwendungen (Apps) werden in der Java-Programmiersprache erstellt. Android hat seit seinem Erscheinen Anfang 2009 einen riesigen Marjkt erschlossen und ist heute auf Smartphones, Mobiltelefonen, Netbooks und Tablet-PCs zuhause.Wir entwickeln Anwendungen f\xfcr das Android OS oder portieren Ihre vorhandenen Anwendungen von anderen Plattformen nach Android."},
gOt(){return"Kundenspezifische Softwareanwendungen"},
gOu(){return"In unseren Projekten setzen wir vorwiegend Java als Programmiersprache ein und nutzen Java-Programmierbibliotheken und -Standards. So bieten wir Entwicklung von\n- Anwendungen auf Basis von Java Swing und Eclipse RCP\n- Client- und Serverkomponenten f\xfcr Web Services\n- Webanwendungen auf Basis des Google Web Toolkit (GWT)\n\nPartMaster wendet bei der Anwendungsentwicklung konsequent agile Methodiken an, so k\xf6nnen Sie als Kunde den Entwicklungsprozess kontinuierlich begleiten und mit gestalten. Sie erhalten fr\xfchzeitig erste Software-Versionen, die Sie an Ihren Anforderungen pr\xfcfen und den weiteren Entwicklungsprozess steuern k\xf6nnen. Sie wird gew\xe4hrleistet, dass Sie am Fertigstellungstermin genau die Software erhalten, die Ihre Anforderungen bestm\xf6glich abdeckt und Ihre Erwartungen optimal erf\xfcllt."},
gq3(){return"Wir entwickeln <em>IT-Strategien</em>, erarbeiten <em>Kriterien</em> f\xfcr den Einsatz und die Auswahl von Technologien und Produkten, erstellen <em>Softwarekomponenten</em> und integrieren diese in bestehende <em>IT-Architekturen</em>. Als kleines, technologieorientiertes Unternehmen \xfcbernehmen wir f\xfcr unsere Kunden die Rolle des <em>Gestalters, Vermittlers und Br\xfcckenbauers</em> um Chancen f\xfcr unsere Kunden nutzbar zu machen, die sich durch neue Technologien bieten.\n\nUnser Ziel ist es, die abzuwickelnden Vorg\xe4nge des Kunden optimal durch eine <em>intuitiv bedienbare Software</em> zu begleiten und dabei die <em>Kreativit\xe4t</em>, die <em>Individualit\xe4t</em> und die M\xf6glichkeiten der <em>Selbstorganisation</em> der Mitarbeiter nicht einzuschr\xe4nken, sondern zu erweitern. Durchgef\xfchrte Arbeiten m\xfcnden <em>schnell</em> in <em>konkreten Ergebnissen</em>, was f\xfcr den Kunden <em>Planungssicherheit</em> und <em>Investitionssicherheit</em> gew\xe4hrleistet."},
gNl(){return"Die Anreise mit dem PKW ist nat\xfcrlich aus verschiedenen Richtungen m\xf6glich. In unmittelbarere N\xe4he unserer B\xfcror\xe4ume befindet sich das City-Parkhaus in der Langen Stra\xdfe, in dem Sie Ihr Auto bequem abstellen k\xf6nnen. Aus dem Parkhaus kommend, wenden Sie sich bitte nach rechts, gehen einige Meter geradeaus und biegen nach links in die Lagerstra\xdfe ein. Der Eingang zu unseren B\xfcros befindet sich gleich hier im Hofbereich."},
gNn(){return"Vom Rostocker Hauptbahnhof kommen Sie direkt mit der Stra\xdfenbahn in die Innenstadt. Hier benutzen Sie die Bahnen in Richtung City. An der Haltestelle 'Neuer Markt' steigen Sie aus und folgen dem Verlauf der Stra\xdfenbahnschienen, vorbei an der Marienkirche. An der n\xe4chsten Ampel \xfcberqueren Sie die Stra\xdfenbahnschienen ('Lange Stra\xdfe'). Folgen Sie dann dem Verlauf der Langen Stra\xdfe einige Meter bis Sie rechts einen gro\xdfen Torbogen-Eingang sehen. Diesen Eingang gehen sie hindurch, die Treppe hinunter und wenden sich nach rechts. Sie gehen etwa 10 Meter geradeaus und biegen dann wieder links ab. Hier \xfcber diesen Innenhof erreichen Sie unsere B\xfcros."},
