gNl(){return"The journey by car is of course possible from different directions. In the immediate vicinity of our offices there is a city car park on Langen Stra\xdfe, where you can conveniently park your car. Coming out of the multi-storey car park, please turn right, walk straight ahead for a few meters and turn left into Lagerstrasse. The entrance to our offices is right here in the courtyard area."},
gNn(){return"From Rostock central station you can take the tram directly to the city center. Here you use the trains in the direction of the city. Get off at the 'Neuer Markt' stop and follow the tram tracks past the Marienkirche. At the next traffic light, cross the tram tracks ('Lange Stra\xdfer'). Then follow the course of Langen Stra\xdfe for a few meters until you see a large archway entrance on the right. Go through this entrance, down the stairs and turn right. Go straight ahead for about 10 meters and then turn left again. You can reach our offices via this inner courtyard."},
